import React from 'react';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

import MasterLayout from './layouts/frontend/MasterLayout';

function App() {
  return (
    <div className="App">
      <Router>
          <Routes>
            <Route path="/" exact element={<MasterLayout />} />
          </Routes>
      </Router>
    </div>
  );
}

export default App;
